import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'durationSince'
})
export class DurationSincePipe implements PipeTransform {

  transform(value: string, args?: any): any {
    const seconds: number = Math.floor((+new Date() - +new Date(value)) / 1000);
    let interval: number = Math.floor(seconds / 31536000);
    // years
    if (interval >= 1) {
      if (interval === 1) {
        return interval + ' year ago';
      } else {
        return interval + ' years ago';
      }
    }
    // months
    interval = Math.floor(seconds / 2592000);
    if (interval >= 1) {
      if (interval === 1) {
        return interval + ' month ago';
      } else {
        return interval + ' months ago';
      }
    }
    // weeks
    interval = Math.floor(seconds / 604800);
    if (interval >= 1) {
      if (interval === 1) {
        return interval + ' week ago';
      } else {
        return interval + ' weeks ago';
      }
    }
    // days
    interval = Math.floor(seconds / 86400);
    if (interval >= 1) {
      if (interval === 1) {
        return ' yesterday';
      } else {
        return interval + ' days ago';
      }
    }
    // hours
    interval = Math.floor(seconds / 3600);
    if (interval >= 1) {
      if (interval === 1) {
        return interval + ' hour ago';
      } else {
        return interval + ' hours ago';
      }
    }
    // minutes
    interval = Math.floor(seconds / 60);
    if (interval >= 1) {
      if (interval === 1) {
        return interval + ' minute ago';
      } else {
        return interval + ' minutes ago';
      }
    }

    return 'Just now';
  }

}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'ellipsis'
})
export class EllipsisPipe implements PipeTransform {

  transform(value: any, args?: number): any {
    if (args === undefined) {
      return value;
    }

    if (value && value.length > args) {
      return value.substring(0, args) + '...';
    } else {
      return value;
    }
  }

}

import { Pipe, PipeTransform } from '@angular/core';
import {SafeHtml} from '@angular/platform-browser';

@Pipe({
  name: 'highlight'
})
export class HighlightPipe implements PipeTransform {

// todo: from https://gist.github.com/adamrecsko/0f28f474eca63e0279455476cc11eca7
// post by ankitgrover

  /* use this for single match search */
  static SINGLE_MATCH = 'Single-Match';
  /* use this for single match search with a restriction that target should start with search string */
  static SINGLE_AND_STARTS_WITH_MATCH = 'Single-And-StartsWith-Match';
  /* use this for global search */
  static MULTI_MATCH = 'Multi-Match';

  transform(data: string,
            highlightText: string,
            option: string = 'Single-And-StartsWith-Match',
            caseSensitive: boolean = false,
            highlightStyleName: string = 'search-highlight'): SafeHtml {
    if (highlightText && data && option) {
      let regex: any = '';
      const caseFlag: string = !caseSensitive ? 'i' : '';
      switch (option) {
        case 'Single-Match': {
          regex = new RegExp(highlightText, caseFlag);
          break;
        }
        case 'Single-And-StartsWith-Match': {
          regex = new RegExp('^' + highlightText, caseFlag);
          break;
        }
        case 'Multi-Match': {
          regex = new RegExp(highlightText, 'g' + caseFlag);
          break;
        }
        default: {
          // default will be a global case-insensitive match
          regex = new RegExp(highlightText, 'gi');
        }
      }
      return data.replace(regex, (match) => `<span class="${highlightStyleName}">${match}</span>`);

    } else {
      return data;
    }
  }

}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'orderByDate'
})
export class OrderByDatePipe implements PipeTransform {

  transform(array: any[], field: string): any[] {
    return array.sort(function(a, b) {
        a = new Date(a[field]);
        b = new Date(b[field]);
        return a > b ? -1 : a < b ? 1 : 0;
    });
  }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'reverse',
  pure: false
})
export class ReversePipe implements PipeTransform {

  transform(value: any, args?: any): any {
      return value.slice().reverse();
  }

}

